import '../style.css';
import ServiceType from './ServiceType';

function SelectService() {
    return (
        <div>
            <ServiceType type="Air Freight" logo={[<i class="fa fa-plane"></i>]} />
            <ServiceType type="Sea Frei" logo={[<i class="fa fa-plane"></i>]} />
            <ServiceType type="Air Freight" logo={[<i class="fa fa-plane"></i>]} />
            <ServiceType type="Air Freight" logo={[<i class="fa fa-plane"></i>]} />
        </div>
    )
}

export default SelectService
